def search_food(food):
    food = food.lower()
    return dataset.get(food, [10.0,5.0,5.0,5.0])

def load_dataset(dataset):
    food_names = []
    food_nutrition_facts = []
    nutri_scores = []

    for food_name, nutrition_facts in dataset.items():
        food_names.append(food_name)
        food_nutrition_facts.append(nutrition_facts[:3])
        nutri_scores.append(nutrition_facts[3])

    return torch.tensor(food_nutrition_facts, dtype=torch.float32), food_names, torch.tensor(nutri_scores, dtype=torch.float32)